import React from "react";
const Education = (props) => {
    return (
        <div id="education">
            <h2 className="headings">EDUCATION</h2>
            <div className="row">
                {props.cards.map((card) => {
                    return (
                        <div className="box" key={card.box}>
                            <h5 className="headings2">{card.h5}</h5>
                            <p>{card.p}
                                <a href={card.href} className="edu"> {card.college}</a> {card.place}
                                <p>{card.p1}{card.year}</p>
                                <p>{card.p2}{card.cgpa}</p>
                            </p>
                        </div>

                    )
                })}
            </div>
        </div>
    )
}
export default Education;
